import Home from './Home';
import Navbar from './Navbar';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Patinage from './Patinage';
import VideoPlayer from './VideoPlayer';

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <div className="content">
          <Switch>
            <Route exact path="/">
              <Home />
            </Route>
            <Route path="/patinage">
              <Patinage />
            </Route>
            <Route path="/video/:id">
              <VideoPlayer />
            </Route>
          </Switch>
        </div>
      </div>
    </Router>
  );
}

export default App;
